cpqRackNameChanged TRAP-TYPE
      ENTERPRISE compaq
      VARIABLES { sysName, cpqHoTrapFlags, cpqRackName, cpqRackUid, cpqRackSerialNum, cpqRackTrapSequenceNum }
      --#SUMMARY "The rack name has changed to %s."
      --#ARGUMENTS {2}
      --#SEVERITY INFORMATIONAL
      --#TIMEINDEX 99
      --#STATE OPERATIONAL
      --#MSG_FORMATTER "$V3V#Rack Name: # $V4V#Rack ID: #  $V5V#Rack Serial Number: #"
      --#TYPE "Rack name changed (22001)"
      --#ENABLE true
      --#CATEGORY "Proliant Rack Events"
      --#RULE_HANDLER "com.hp.mx.core.protocol.snmp.trap.components.RackNameChangeTrapRuleHandler"
      --#NOTICE_HANDLER "com.hp.mx.portal.alerts.handlers.RackTrapNoticeHandler"
DESCRIPTION "Rack name has changed.  This trap signifies that an agent or utility has changed the name of the rack.  Each of the server blades in each of the enclosure within the rack will be updated to reflect the new rack name.  It may take several minutes for the rack name change to be propagated throughout the entire rack.  User Action: None."
      ::= 22001


